;; **
;;; # Gaussian Mixture Model - fixed number of clusters
;;; 
;;; In this worksheet, we demonstrate inference compilation on a Gaussian mixture model with fixed number of clusters which was used to reproduce Figure 4 in [the paper](https://arxiv.org/abs/1610.09900).
;; **

;; @@
(ns gmm-fixed-number-of-clusters
  (:require anglican.infcomp.csis
            anglican.infcomp.core
            anglican.smc
            [anglican.infcomp.zmq :as zmq]
            [anglican.infcomp.prior :as prior]
            [anglican.inference :refer [infer]]
            [anglican.stat :refer [collect-results]]
            [clojure.core.matrix :as m]
            [clojure.core.matrix.linear :as mlin]
            [helpers.gmm :refer [normalize move-to-unit-box gridify]]
            [helpers.general :refer [empirical-MAP]]
            [gorilla-repl.image :as image]
            [clojure.java.shell :refer [sh]])
  (:use [anglican emit runtime]
        [gorilla-plot core])
  (:import [robots.OxCaptcha OxCaptcha]
           [javax.imageio ImageIO]
           [java.io File]))

(anglican.infcomp.core/reset-infcomp-addressing-scheme!)
