;; **
;;; ## Inference comparison
;; **

;; **
;;; ### Synthetic data generation
;; **

;; @@
(def grid-dimensions [100 100])
(def num-data-points 100)
(with-primitive-procedures [m/mmul m/identity-matrix]
  (defquery gmm-fixed [data cluster-probs means vars]
    (map #(let [cluster (sample "cluster" (discrete cluster-probs))
                mean (nth means cluster)
                var (nth vars cluster)]
            (observe (mvn mean (mmul var (identity-matrix 2))) %)
            cluster)
         data)))
(def smp (first (anglican.infcomp.prior/sample-from-prior gmm-fixed [(repeatedly num-data-points rand) [1 1 1] [[-0.3 -0.2] [0.1 0.1] [0.7 0.0]] [0.005 0.005 0.005]])))
(def data (map :value (:observes smp)))
(def ground-means (map :value (:samples smp)))
(def observe-embedder-input (gridify (move-to-unit-box data) grid-dimensions))

(.save (OxCaptcha. (first grid-dimensions) (second grid-dimensions))
       (int-array (map #(int (* 255 %)) (flatten observe-embedder-input)))
       (first grid-dimensions)
       (second grid-dimensions)
       "tmp.png")
(image/image-view (ImageIO/read (File. "tmp.png")))
