;; **
;;; #### CSIS
;; **

;; @@
(def num-samples-seq [1 10 100 1000 10000])
(def num-reruns 50)

(time
  (loop [num-samples-seq num-samples-seq]
    (if (empty? num-samples-seq)
      nil
      (let [num-samples (first num-samples-seq)
            means-MAP-list (repeatedly num-reruns #(let [csis-states (take num-samples (infer :csis gmm [data hyperparameters] :observe-embedder-input observe-embedder-input))
                                                         csis-logw (collect-results csis-states)
                                                         csis-MAP (empirical-MAP csis-logw)]
                                                     (:means csis-MAP)))]
        (spit (str "plots/gmm-fixed-number-of-clusters/csis-" num-samples ".csv")
              (str "num-reruns," num-reruns "\n"
                   "num-samples," num-samples "\n"
                   "dimension," (count (first data)) "\n"
                   "data," (clojure.string/join "," (flatten data)) "\n"
                   "means-MAP-list," (clojure.string/join "," (flatten means-MAP-list)) "\n"))
        (recur (rest num-samples-seq))))))
